import Card from 'react-bootstrap/Card';

function Welcome() {
    return (
        <Card>
            <h1> A DB project for CSI3430.</h1>
            <h1> Group Memebers</h1>
            <Card.Body>Aden</Card.Body>
            <Card.Body>Patrick</Card.Body>
            <Card.Body>Claire</Card.Body>
        </Card>
    );
}

export default Welcome;
